import { flexbox } from '@material-ui/system';
import { Card, Container } from '@mui/material';
import React from 'react';
import { Button, Form } from 'react-bootstrap';

const Auth = () => {
    return (
        
        <Container 
            style={{height:200,marginTop:20, justifyContent:'center', alignItems:'center', display:'flex'}}
        >
            <Card  style={{width:600, padding:5, color:'black', justifyContent:'center'}}>
                <h2  style={{justifyContent:'center', display:'flex'}}>Authorization</h2>   
                <Form style={{ padding:5, color:'black', justifyContent:'center' }}>
                    <Form.Control 
                        style={{height:30, width:566, marginTop:7, marginBottom:7 ,marginLeft:7,marginRight:7, display:'flex', justifyContent:'center'}}
                        placeholder="Enter an email"
                    />
                    <Form.Control 
                        style={{height:30, width:566, marginTop:8, marginBottom:7 ,marginLeft:7,marginRight:7, display:'flex', justifyContent:'center'}}
                        placeholder="Enter a password"
                    />
                    <Button style={{fontVariant:'outline'}}variant="outlined-success">
                        Join
                    </Button>
                </Form>
            </Card>
            
        </Container>
    );
};

export default Auth;
